import React from 'react';
import goods from './goods/goods.json'

interface goods {
  id: id
}
interface id {
  image: string,
  name: string,
  sizeType: string,
  size: number,
  barcode: number,
  producer: string,
  brand: string,
  desription: string,
  price: number
}



function App() {
  return (
    <div>
      <h1>Unbelievable!</h1>
      <p>{goods.name}</p>
    </div>
  );
}

export default App;
